import React from 'react';
import { connect } from 'react-redux';
import todoListContainer from '../containers/todosList.container';
import { PropTypes } from 'prop-types';

const TodosTable = ({todoList}) => {

    if (todoList !== undefined) {
        todoList = todoList.map(todo => {
            console.log(todo.todoCompleted);
            return {
                _id: todo._id,
                todoDescription: todo.todoDescription,
                todoResponsible: todo.todoResponsible,
                todoPriority: todo.todoPriority,
                todoCompleted: todo.todoCompleted,
            }
        })
    }

    return (
        <table className='table table-hover'>
                <thead>
                    <tr>
                        <th>Description</th>
                        <th>Responsible</th>
                        <th>Priority</th>
                        <th>Completed</th>
                        <th>Actions</th>
                    </tr>
                </thead>
                <tbody>
                    {todoList.map(todo => {
                        return (
                            <tr key={todo._id}>
                                <td>{todo.todoDescription}</td>
                                <td>{todo.todoResponsible}</td>
                                <td>{todo.todoPriority}</td>
                                <td>{todo.todoCompleted === undefined ? '' : '' + todo.todoCompleted}</td>
                            </tr>
                        )
                    })}
                </tbody>
            </table>
    )
}

TodosTable.protypes = {
    todoList: PropTypes.array,
}

export default connect(todoListContainer.mapStateToProps)(TodosTable);
